import {BrowserRouter as Router, Routes, Route} from "react-router-dom";
import Login from "./components/Login";
import './App.css';

function App() {
  return (
    <div className="App">
      <Routes>
      <Router>
          <Route exact path="/" element={<Login />}>
          </Route>
      </Router>
      </Routes>
    </div>
  );
}

export default App;
